import React from 'react';
import { useTranslation } from 'react-i18next';

const ProductCompliance = () => {
  const { t } = useTranslation();

  // Access translation data
  const complianceData = t('productCompliance', { returnObjects: true });

  return (
    <div id="product-compliance-container">
      <h1>{complianceData?.title}</h1>
      <p>{complianceData?.welcome}</p>

      <section>
        <h2>{complianceData?.compliance_and_requirements?.title}</h2>
        <p>{complianceData?.compliance_and_requirements?.description}</p>
        <p>{complianceData?.compliance_and_requirements?.evaluation}</p>
        <p>{complianceData?.compliance_and_requirements?.backoffice}</p>
        <ul>
          {(complianceData?.compliance_and_requirements?.details || []).map((detail, index) => (
            <li key={index}>{detail}</li>
          ))}
        </ul>
      </section>

      <section>
        <h2>{complianceData?.non_compliance_consequences?.title}</h2>
        <p>{complianceData?.non_compliance_consequences?.description}</p>
        <ul>
          {(complianceData?.non_compliance_consequences?.sanctions || []).map((sanction, index) => (
            <li key={index}>{sanction}</li>
          ))}
        </ul>
      </section>

      <section>
        <h2>{complianceData?.communication_with_buyers?.title}</h2>
        <p>{complianceData?.communication_with_buyers?.description}</p>
        <ul>
          {(complianceData?.communication_with_buyers?.requirements || []).map((requirement, index) => (
            <li key={index}>{requirement}</li>
          ))}
        </ul>
      </section>

      <section>
        <h2>{complianceData?.platform_commitment?.title}</h2>
        <p>{complianceData?.platform_commitment?.description}</p>
      </section>

      <section>
        <h2>{complianceData?.compliance_responsibilities?.title}</h2>
        <ul>
          {(complianceData?.compliance_responsibilities?.participants || []).map((participant, index) => (
            <li key={index}>{participant}</li>
          ))}
        </ul>
      </section>

      {complianceData?.legal_and_regulatory_updates && (
        <section>
          <h2>{complianceData.legal_and_regulatory_updates.title}</h2>
          <p>{complianceData.legal_and_regulatory_updates.description}</p>
        </section>
      )}
    </div>
  );
};

export default ProductCompliance;
